import React, { Component } from "react";

import {
  Button,
  Form,
  FormGroup,
  Label,
  Input,
  FormText,
  Container,
  Row,
  Col,
} from "reactstrap";

class AÃ±adirTarjeta extends Component {
  state = {
    numero: "",
    descripcion: "",
    color: "",
    detecto: "",
    prioridad: "",
    familia: "",
    maquina: "",
    equipo: "",
    msg: null,
  };

  componentDidUpdate(prevProps) {
    const { error } = this.props;
    if (error !== prevProps.error) {
      //Check for login error
      console.log(error.msg.msg);
      if (error.id === "AGREGAR_TARJETA_ERROR") {
        this.setState({
          msg: error.msg.msg,
        });
      } else {
        this.setState({
          msg: null,
        });
      }
    }
  }

  onChange = (e) => {
    this.setState({ [e.target.name]: e.target.value });
  };
  onSubmit = (e) => {
    e.preventDefault();
    const {
      numero,
      descripcion,
      color,
      detecto,
      prioridad,
      familia,
      maquina,
      equipo,
    } = this.state;

    // Create usre object
    const newTicket = {
      numero,
      descripcion,
      color,
      detecto,
      prioridad,
      familia,
      maquina,
      equipo,
    };
    this.props.createTicket(newTicket);
    if (numero === "") {
      console.log("Error");
    } else {
      this.toggle();
    }
  };
  render() {
    return (
      <div>
        <div className="page-wrapper d-block">
          <div className="page-content container-fluid">
            <Container>
              <h2 className="my-2">AÃ±adir nueva tarjeta</h2>
              <Form className="mt-4">
                <Row>
                  <Col>
                    <FormGroup>
                      <Label for="text">Maquina *</Label>
                      <Input type="text" name="text" id="text" />
                    </FormGroup>

                    <FormGroup>
                      <Label for="exampleSelect">Prioridad *</Label>
                      <Input type="select" name="select" id="exampleSelect">
                        <option>Alta</option>
                        <option>Media</option>
                        <option>Baja</option>
                      </Input>
                    </FormGroup>

                    <FormGroup>
                      <Label for="examplePassword">Descripcion *</Label>
                      <Input
                        type="text"
                        name="text"
                        id="examplePassword"
                        bsSize="lg"
                      />
                    </FormGroup>
                  </Col>
                  <Col>
                    <FormGroup>
                      <Label for="text">Equipo *</Label>
                      <Input type="text" name="text" id="text" />
                    </FormGroup>

                    <FormGroup>
                      <Label for="exampleSelect">Tipos de anormalidad *</Label>
                      <Input type="select" name="select" id="exampleSelect">
                        <option>1 - PequeÃ±as Deficiencia</option>
                        <option>2 - Condiciones basicas</option>
                        <option>3 - Puntos inaccesibles</option>
                        <option>4 - Focos de contaminacion</option>
                        <option>5 - Defecto de Calidad</option>
                        <option>6 - Elementos Innecesarios</option>
                        <option>7 - Lugares Inseguros</option>
                      </Input>
                    </FormGroup>
                    <FormGroup>
                      <Label for="examplePassword">Detecto *</Label>
                      <Input type="text" name="text" id="examplePassword" />
                    </FormGroup>
                  </Col>
                </Row>
                <Row className="mt-3">
                  <Col>
                    <Button>Subir</Button>
                  </Col>
                </Row>
              </Form>
            </Container>
          </div>
        </div>
      </div>
    );
  }
}
export default AÃ±adirTarjeta;
